import { combineReducers } from "redux";
import {
  findUnitById,
  findUnits,
  deletedById,
  editUnitById,
  addUnits
} from "./units";

export default combineReducers({
  deletedById,
  findUnitById,
  findUnits,
  editUnitById,
  addUnits
});
